import Layout from "../components/Layout";
import Feed from "../components/feed";
import Placard from "../components/placard";

import { Grid } from "@material-ui/core";

const Index = () => (
  <Layout>
    <Grid container>
      <Grid item lg={3} xs={12}>
        <Placard align="right" />
      </Grid>
      <Grid item lg={6} xs={12}>
        <Feed />
      </Grid>
      <Grid item lg={3} xs={12}>
        <Placard />
      </Grid>
    </Grid>
  </Layout>
);

export default Index;
